import * as React from 'react';
import classNames from 'classnames';

export default class LoginForm extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            active: "login",
            login: "",
            password: "",
            onLogin: props.onLogin,
            onRegister: props.onRegister
        };
    }

    onChangeHandler = (event) => {
        let name = event.target.name;
        let value = event.target.value;
        this.setState({ [name]: value });
    }

    onSubmitLogin = (e) => {
        this.state.onLogin(
            e,
            this.state.login,
            this.state.password
        );
    }

    onSubmitRegister = (e) => {
        this.state.onRegister(
            e,
            this.state.login,
            this.state.password
        )
    }

    render() {
        const isLoginActive = this.state.active === "login";
        const submitButtonText = isLoginActive ? "Zaloguj się" : "Zarejestruj się";

        return (
            <div className="row justify-content-center">
                <div className="col-4">
                    <ul className="nav nav-pills nav-justified mb-3" id="ex1" role="tablist">
                        <li className="nav-item" role="presentation">
                            <button className={classNames("nav-link", isLoginActive ? "active" : "")} id="tab-login"
                                onClick={() => this.setState({ active: "login" })}>Logowanie</button>
                        </li>
                        <li className="nav-item" role="presentation">
                            <button className={classNames("nav-link", !isLoginActive ? "active" : "")} id="tab-register"
                                onClick={() => this.setState({ active: "register" })}>Rejestracja</button>
                        </li>
                    </ul>

                    <div className="tab-content">
                        <div className={classNames("tab-pane", "fade", isLoginActive ? "show active" : "")} id="pills-login" >
                            <form onSubmit={this.onSubmitLogin}>
                                <div className="form-outline mb-4">
                                    <input type="login" id="loginName" name="login" className="form-control" onChange={this.onChangeHandler} />
                                    <label className="form-label" htmlFor="loginName">Login</label>
                                </div>

                                <div className="form-outline mb-4">
                                    <input type="password" id="loginPassword" name="password" className="form-control" onChange={this.onChangeHandler} />
                                    <label className="form-label" htmlFor="loginPassword">Hasło</label>
                                </div>
                                <div className="col-md-12 text-center" style={{ marginTop: '30px' }}>
                                  <button type="submit" className="btn btn-primary btn-block mb-4">{submitButtonText}</button>
                                </div>
                            </form>
                        </div>
                        <div className={classNames("tab-pane", "fade", !isLoginActive ? "show active" : "")} id="pills-register" >
                            <form onSubmit={this.onSubmitRegister}>
                                <div className="form-outline mb-4">
                                    <input type="text" id="login" name="login" className="form-control" onChange={this.onChangeHandler} />
                                    <label className="form-label" htmlFor="login">Login</label>
                                </div>

                                <div className="form-outline mb-4">
                                    <input type="password" id="registerPassword" name="password" className="form-control" onChange={this.onChangeHandler} />
                                    <label className="form-label" htmlFor="registerPassword">Hasło</label>
                                </div>
                                <div className="col-md-12 text-center" style={{ marginTop: '30px' }}>
                                  <button type="submit" className="btn btn-primary btn-block mb-3">{submitButtonText}</button>
                                </div>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
